import React from 'react';
import '../../App.css';
import Dashboards from '../Dashbar';
import Footer from '../Footer';

function Dashboard({ hospital, handleLogout }) {
    return (
        <>
            <Dashboards hospital={hospital} handleLogout={handleLogout} /> 
            <Footer />
        </>
    );
}

export default Dashboard;
